import React from 'react';

// import '../css/Form.css'

const Form = (props) => {
    return (
        <div className="form">
            <form onSubmit={(event) => props.addTodo('aaa', event)}>
                <p><input type="text" /></p>
                <p><button type="submit">追加する</button></p>
            </form>
        </div>
    );
}

export default Form;
